import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import Container from '@mui/material/Container';
import Grid from '@mui/material/Grid';
import IconButton from '@mui/material/IconButton';
import InputBase from '@mui/material/InputBase';
import MenuIcon from '@mui/icons-material/Menu';
import Paper from '@mui/material/Paper';
import SearchIcon from '@mui/icons-material/Search';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { useState } from 'react';

// Define a custom theme
const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#000',
      paper: '#121212',
    },
    text: {
      primary: '#fff',
      secondary: '#b0bec5',
    },
  },
});

const tournaments = [
  { id: 1, name: 'Soccer Championship', location: 'New York', date: '2024-09-12', description: 'A thrilling soccer tournament with top teams.' },
  { id: 2, name: 'Basketball Tournament', location: 'Los Angeles', date: '2024-10-05', description: 'Exciting basketball matches with local and national teams.' },
  { id: 3, name: 'Tennis Open', location: 'Miami', date: '2024-11-20', description: 'Annual tennis open featuring international players.' },
  // Add more tournament data as needed
];

export default function TournamentPage() {
  const [search, setSearch] = useState('');
  const [filter, setFilter] = useState('All');

  const handleSearchChange = (event) => {
    setSearch(event.target.value);
  };

  const handleFilterChange = (event) => {
    setFilter(event.target.value);
  };

  const filteredTournaments = tournaments.filter((tournament) => {
    return (
      (filter === 'All' || tournament.location === filter) &&
      (tournament.name.toLowerCase().includes(search.toLowerCase()) ||
      tournament.description.toLowerCase().includes(search.toLowerCase()))
    );
  });

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="sticky" sx={{ mb: 4 }}>
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu" sx={{ mr: 2 }}>
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            SportsZone
          </Typography>
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
            <Paper component="form" sx={{ p: '2px 4px', display: 'flex', alignItems: 'center', width: 400 }}>
              <InputBase
                sx={{ ml: 1, flex: 1 }}
                placeholder="Search Tournaments"
                inputProps={{ 'aria-label': 'search tournaments' }}
                value={search}
                onChange={handleSearchChange}
              />
              <IconButton type="submit" sx={{ p: '10px' }} aria-label="search">
                <SearchIcon />
              </IconButton>
            </Paper>
            <Button variant="outlined" onClick={() => setFilter('All')}>All Locations</Button>
            <Button variant="outlined" onClick={() => setFilter('New York')}>New York</Button>
            <Button variant="outlined" onClick={() => setFilter('Los Angeles')}>Los Angeles</Button>
            <Button variant="outlined" onClick={() => setFilter('Miami')}>Miami</Button>
          </Box>
        </Toolbar>
      </AppBar>
      <Container>
        <Typography variant="h4" component="div" gutterBottom>
          Upcoming Tournaments
        </Typography>
        <Grid container spacing={2}>
          <Grid item xs={12}>
            <Box sx={{ display: 'flex', overflowX: 'auto', gap: 2 }}>
              {filteredTournaments.map((tournament) => (
                <Paper key={tournament.id} sx={{ width: 300, p: 2, borderRadius: '12px', boxShadow: 3 }}>
                  <Typography variant="h6" component="div">
                    {tournament.name}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Location: {tournament.location}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Date: {tournament.date}
                  </Typography>
                  <Typography variant="body2" sx={{ mt: 1 }}>
                    {tournament.description}
                  </Typography>
                </Paper>
              ))}
            </Box>
          </Grid>
        </Grid>
      </Container>
    </ThemeProvider>
  );
}
